package main

func Eat(number, need, remaining int) []int {
	// Calculate how many carrots we can actually eat
	canEat := need
	if need > remaining {
		canEat = remaining
	}

	// Total eaten = what we've already eaten + what we can eat now
	totalEaten := number + canEat

	// Remaining carrots after eating
	leftover := remaining - canEat

	return []int{totalEaten, leftover}
}
